// script.js

// Initialize the map and set the view to a central location in the Rift Valley
var map = L.map('map').setView([-0.5, 36.0], 6);

// Add OpenStreetMap tile layer
L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
    attribution: '&copy; OpenStreetMap contributors'
}).addTo(map);

// Lake data with tourist information
var lakes = [
    {
        name: "Lake Naivasha",
        lat: -0.7167,
        lon: 36.4333,
        img: "data:image/jpeg;base64,", // Replace with actual image URL
        description: "Lake Naivasha is a freshwater lake located in Nakuru County. It's a popular spot for bird watching and boat rides. You can also visit Crescent Island, home to a variety of wildlife including giraffes, zebras, and antelopes."
    },
    {
        name: "Lake Nakuru",
        lat: -0.3667,
        lon: 36.0833,
        img: "data:image/jpeg;base64,", // Replace with actual image URL
        description: "Lake Nakuru, famous for its large population of flamingos, is located in Lake Nakuru National Park. Visitors can enjoy game drives to see lions, rhinos, and leopards."
    },
    {
        name: "Lake Elementaita",
        lat: -0.4500,
        lon: 36.2333,
        img: "data:image/jpeg;base64,", // Replace with actual image URL
        description: "Lake Elementaita is a shallow soda lake in the Great Rift Valley. It's a UNESCO World Heritage Site and a haven for flamingos, pelicans, and other bird species. The area is ideal for hiking and bird watching."
    },
    {
        name: "Lake Baringo",
        lat: 0.6333,
        lon: 36.0833,
        img: "data:image/jpeg;base64,", // Replace with actual image URL
        description: "Lake Baringo is one of the two freshwater lakes in the Rift Valley. It's great for boat safaris, bird watching, and visiting local islands such as Ol Kokwe, where you can experience the culture of the Njemps people."
    },
    {
        name: "Lake Turkana",
        lat: 3.5833,
        lon: 36.1167,
        img: "data:image/jpeg;base64,", // Replace with actual image URL
        description: "Lake Turkana, also known as the Jade Sea, is the world's largest permanent desert lake. It's famous for its vivid turquoise color and rich prehistoric heritage. Activities include fishing, visiting the Central Island National Park, and exploring nearby archeological sites."
    },
    {
        name: "Lake Bogoria",
        lat: 0.2500,
        lon: 36.0833,
        img: "data:image/jpeg;base64,", // Replace with actual image URL
        description: "Lake Bogoria is a saline, alkaline lake located in the Great Rift Valley. It's known for its geysers, hot springs, and large flocks of flamingos. Visitors can enjoy picnics, nature walks, and bird watching."
    }
];

// Add markers and create story content
var contentDiv = document.getElementById('content');

lakes.forEach(function(lake) {
    // Add a marker on the map
    var marker = L.marker([lake.lat, lake.lon]).addTo(map)
        .bindPopup(`<b>${lake.name}</b><br>${lake.description}`);

    // Create a section in the story content
    var lakeSection = document.createElement('div');
    lakeSection.className = 'lake-section';

    var lakeTitle = document.createElement('h2');
    lakeTitle.textContent = lake.name;
    lakeSection.appendChild(lakeTitle);

    var lakeImage = document.createElement('img');
    lakeImage.src = lake.img;
    lakeSection.appendChild(lakeImage);

    var lakeDescription = document.createElement('p');
    lakeDescription.textContent = lake.description;
    lakeSection.appendChild(lakeDescription);

    contentDiv.appendChild(lakeSection);

    // Add interaction: Scroll to map marker when lake name is clicked
    lakeTitle.addEventListener('click', function() {
        map.setView([lake.lat, lake.lon], 10);
        marker.openPopup();
    });
});
